{"source":{"uri":"features/specs/cadastro.feature","data":"# language: pt\n\n@regression\n@cadastro\nFuncionalidade: Cadastro\nCOMO novo usuário do Ecommerce Serverest Store\nQUERO me cadastrar \nPARA realizar compras\n\nContexto: Acessar pagina de cadastro\n  Dado que esteja na pagina de cadastro\n\n@add_user\nCenário: Cadastro de usuário comum\n  Quando informar os campos \"<nome>\",\"<email>\",\"<senha>\"\n  E exibir a mensagem \"<msg>\"\n  Então cadastro deverá ser concluido\n\n  Exemplos:\n  |nome |email                |senha |msg                           |\n  |caua |caua2082@hotmail.com |141414|Cadastro realizado com sucesso|\n  # |erick|erick2420@hotmail.com|777774|Cadastro realizado com sucesso|\n  # |caue |caue2254@hotmail.com |456785|Cadastro realizado com sucesso|\n  # |fabio|fabio1660@hotmail.com|344356|Cadastro realizado com sucesso|\n\n@add_user_adm\nCenário: Cadastro de usuário adm\n  Quando informar os campos \"<nome>\",\"<email>\",\"<senha>\"\n  E marcar a opção Cadastrar como administrador?\n  Então cadastro deverá ser concluido\n\n  Exemplos:\n  |nome   |email            |senha |\n  |daniela|dani394@gmail.com|151515|","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/specs/login.feature","data":"# language : pt\n\n@regression\n@login\nFuncionalidade: Login\nCOMO usuário do Ecommerce Serverest Store\nQUERO realizar a autenticação\nPARA acessar a home da pagina\n\nContexto: Acessar página de Login\n  Dado que a página de login esteja aberta\n\n@login_valido\nCenário: login valido\n  Quando realizar login informando \"<email>\",\"<senha>\" ja cadastrados\n  Então login deverá ser concluido com sucesso\n\n  Exemplos:\n  |email                |senha |\n  |caua2033@hotmail.com |141414|\n  # |erick2020@hotmail.com|777774|\n  # |caue2204@hotmail.com |456785|\n  # |fabio1260@hotmail.com|344356|\n\n@login_invalido\nCenário: login invalido\n    Quando realizar login informando \"<email>\",\"<senha>\" não cadastrados\n    Então deverá exibir a mensagem \"<msg>\"\n\n    Exemplos:\n  |email                |senha|msg                               |\n  |chis@gmail.com       |12345|Email e/ou senha inválidos        |\n  |erick2020@hotmail.com|     |Password não pode ficar em branco |\n  |                     |44444|Email é obrigatório               |","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/specs/produto.feature","data":"#language: pt\n\n@regression\n@products\nFuncionalidade: Produtos\n  COMO usuário do Ecommerce ServeRest Store\n  QUERO buscar por produtos eletrônicos\n  PARA realizar compras\n\nContexto: Acesso a home\n  Dado que acesse a home\n  E esteja logado\n   \n@search_successfully\n  Cenário: Buscar produto com sucesso\n    Quando realizar uma busca por um produto existente\n    Então deverão ser retornados resultados na busca\n\n@search_without_success\n  Cenário: Buscar produto sem resultado\n   Quando realizar uma busca por um produto inexistente\n   Então devera apresentar a mensagem \"<msg>\"\n\n@add_product_list\n  Cenário: Adicionar produto a lista de compras\n  Quando buscar por um produto desejado\n  E clicar em adicionar a lista\n  Então o produto deverá ser exibido na lista de compras","mediaType":"text/x.cucumber.gherkin+plain"}},
